import React from 'react'


const TextEffect17 = () => {
  return (
    <div className="text-gray-500 text-2xl  lg:text-4xl font-bold flex flex-col justify-around mb-4 tracking-wide">

      <div className="overflow-hidden h-14">
        <div className="animate-slide"><span className="inline-block text-white py-1 px-3 mt-1 mb-11 bg-blue-500">Full-stack developer </span></div>
        <div><span className="inline-block text-white py-1 px-3 mb-11 bg-green-500">Front-end developer </span></div>
        <div><span className="inline-block text-white pt-3 pb-1 md:pt-1 md:py-1 px-3 mb-11 bg-red-500">Back-end developer </span></div>
      </div>

    </div>
  )
}

export default TextEffect17


